import React from "react";
import classes from "./Details.module.css";
import Detail from "../Detail/Detail";
import { connect } from "react-redux";
import Login from "../Login/Login";

const Details = props => {
  let data, keys;

  if (props.data !== undefined) {
    data = props.data;
    keys = Object.keys(data);
  }
  let list;

  if (props.isLogged) {
    const loggedUser = "naveen";
    list = keys.map(key => {
      if (data[key][loggedUser] === undefined) return;
      return (
        <Detail
          id={key}
          name={data[key][loggedUser].name}
          message={data[key][loggedUser].message}
          subject={data[key][loggedUser].subject}
          email={data[key][loggedUser].email}
        />
      );
    });
  } else {
    console.log("not logged");
    let users = Object.keys(keys);
    list = users.map(key => {
      return (
        <Detail
          id={key}
          name={data[key][users].name}
          message={data[key][users].message}
          subject={data[key][users].subject}
          email={data[key][users].email}
        />
      );
    });
  }
  return (
    <div>
      {props.loading ? "Loading..." : null}
      {props.isLogged ? (
        <>
          <center>
            <h2>Records</h2>
          </center>
          <center>
            <table className={classes.table}>
              <tbody>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Message</th>
                </tr>
                {list}
              </tbody>
            </table>
          </center>
        </>
      ) : (
        <Login />
      )}
    </div>
  );
};
const mapStateToProps = state => ({
  loading: state.loading,
  isLogged: state.isLogged,
  data: state.data
});

export default connect(
  mapStateToProps,
  null
)(Details);
